export default () => {
  useEffect( () => {
    const load = async () => {
      let list = await ApiRequest.getList();
      console.log(list);
    }
    load();
  }, [])
  return (
    <div className='homepage'>
      //header
      Filme principal
      Listas
      Footer basico
    </div>
  );
}
